import React from "react";

type AccordionType = {
    title:string
    collapsed:boolean;
}

export function Accordion (props:AccordionType){

    return (<div>


        {!props.collapsed &&<AccordionTitle title={props.title}/>}
    </div>)


}

type AccordionTitle = {
    title:string;
}

export function AccordionTitle (props:AccordionTitle){
    return (
        <div>
            <h3>---{props.title}---</h3>


        </div>
    )
}

export function AccordionBody (props:any){
    return (
        <div>

            <ul>
                <li>1</li>
                <li>2</li>
                <li>3</li>
            </ul>

        </div>
    )
}
